import React from 'react';

function SurveyQuestion(props) {
  const { question } = props;
  return (
    <div>
      <h2>{question.text}</h2>
      <ul>
        {Object.values(question.answers).sort((a, b) => a.order - b.order).map(answer => (
          <li key={answer.order}>{answer.text}</li>
        ))}
      </ul>
    </div>
  );
}

export default SurveyQuestion;
